import React, { Fragment} from 'react';

import './book-list-item.css'

 const BookListItem = ({book}) => { 

    const { title, author } = book

     return (
        <Fragment classNmae="book-li-item">
            <span>
                {title}
            </span>
            <span>
                {author}
            </span>
        </Fragment>
     )
 }

 export default BookListItem
